// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;
// pragma experimental ABIEncoderV2;

contract MedicalChain {
    mapping (address => bool ) public adminMapping;

    constructor() public {
        adminMapping[msg.sender] = true;
    }

    modifier onlyAdmin() {
        require(adminMapping[msg.sender]);
        _;
    }

    modifier onlyDoctor() {
        require(isADoctor[msg.sender], "Not a Doctor");
        _;
    }

    modifier onlyAssignedDoctor(uint _id) {
        require(isADoctor[msg.sender], "Not a Doctor");
        require(patientMapping[_id].assignedDoctors[msg.sender], "You are not assigned to this patient");
        _;
    }

    uint public doctorMappingCount;
    uint public patientMappingCount;
    uint public diseaseMappingCount;
    uint public diseasesForPublicDonationCount;

    mapping(uint => Patient) public patientMapping;
    mapping(address => Patient) public patientAddressMapping;
    mapping(uint => Doctor) public doctorMapping;
    mapping(address => bool) public isADoctor;
    // mapping(address => ) doctorDashboardMapping;
    mapping(uint => diseasePublic) public diseasesForPublicDonationMapping;

    struct Patient{
        uint id;
        string name;
        uint phoneNo;
        string email;
        address patientAddress;
        uint donatedFunds;
        mapping(address => bool) assignedDoctors;
        mapping(uint => Disease) diseaseMapping;
    }

    struct Disease {
        uint id;
        string name;
        string ipfsHash;
        address diseaseDoctor;
    }

    struct diseasePublic {
        uint id;
        uint patientId;
        string name;
        address patientAddressToDonateFunds;
        uint funds;
    }

    struct Doctor{
        uint id;
        address docAddress;
        string docName;
        string docSpecialisation;
    }

    //adding patient, doctor, assigning doctor onlyAdmin()
    function addNewPatient(string memory _name, string memory _email, uint _phoneNo, address _address) public onlyAdmin {
        Patient memory _newpatient;
        _newpatient.id = patientMappingCount;
        _newpatient.name = _name;
        _newpatient.email = _email;
        _newpatient.phoneNo = _phoneNo;
        _newpatient.patientAddress = _address;
        patientMapping[patientMappingCount] = _newpatient;
        patientAddressMapping[_address] = _newpatient;
        patientMappingCount ++;
    }

    function addNewDoctor(string memory _docName, address _docAddress, string memory _docSpecialisation) public onlyAdmin {
        Doctor memory _newDoctor;
        _newDoctor.id = doctorMappingCount;
        _newDoctor.docAddress = _docAddress;
        _newDoctor.docName = _docName;
        _newDoctor.docSpecialisation = _docSpecialisation;
        doctorMapping[doctorMappingCount] = _newDoctor;
        doctorMappingCount++;
    }

    function assignDoctor(address _docAddress, uint _patientId, address _address) public onlyAdmin {
        require(isADoctor[_docAddress], "Not a doctor address");
        patientMapping[_patientId].assignedDoctors[_docAddress] = true;
        patientAddressMapping[_address].assignedDoctors[_docAddress] = true;
    }

    //adding new Disease to diseaseMapping and abstract disease to diseasePublic
    function addNewDisease(uint _id, string memory _name, string memory _ipfsHash) public onlyAssignedDoctor(_id) {

        Disease memory _disease;
        address _patientAddressToDonateFunds = patientMapping[_id].patientAddress;

        _disease.id = diseaseMappingCount;
        _disease.name = _name;
        _disease.ipfsHash = _ipfsHash;
        _disease.diseaseDoctor = msg.sender;
        patientMapping[_id].diseaseMapping[diseaseMappingCount] = _disease;
        diseaseMappingCount++;

        diseasePublic memory _diseasePublic;

        _diseasePublic.id = diseaseMappingCount;
        _diseasePublic.patientId = _id;
        _diseasePublic.name = _name;
        _diseasePublic.patientAddressToDonateFunds = _patientAddressToDonateFunds;
        diseasesForPublicDonationMapping[diseasesForPublicDonationCount] = _diseasePublic;
        diseasesForPublicDonationCount++;
    }

    //add new admin
    function addNewAdmin(address _address) public onlyAdmin {
        require(adminMapping[msg.sender], "Not an Admin");
        adminMapping[_address] = true;
    }

    function donateFunds(uint _id) public payable {
        patientMapping[_id].donatedFunds += msg.value;
    }
}
